import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";

export default class Movies extends Component {
  sstate = {
    movies: getMovies(),
  };

  render() {
    return <div>
        {movies.map(movie => {
            <h2>{movie}</h2>
        })}
    </div>;
  }
}
